import React, { Component } from 'react';
import './App.css';
import Title1 from './comp1'
import Title2 from './comp2'

class App extends Component {
  state = { 
    opinion : "Recommended"
  } 
  render() { 
    return (
      <div className="App">
        <table>
          <tr>
            <td>Hello !!!</td>
          </tr>
        </table>

        <Title1 opinion={this.state.opinion} />
        <Title2 />
      </div>
    );
  }
}

export default App;
